If you have an Object containing a Set with a reference to the Object and you `_.cloneDeep` it, you get `RangeError: Maximum call stack size exceeded`. In the same situation, but with an Array instead of a Set, there's no problem. Here's how you can reproduce it:

```js
var objSet = { x: new Set() };
objSet.x.add(objSet);
_.cloneDeep(objSet);
// RangeError: Maximum call stack size exceeded

var objArr = { x: [] };
objArr.x.push(objArr);
_.cloneDeep(objArr);
// Properly deep-cloned object
```

Seems like circular dependencies aren't properly handled when they're in Sets? From #2137 I saw that support for deep-cloning Sets, Maps, and Symbols was added at 24cef1a. Is this behavior expected? If not, I'd be happy to attempt a fix. Seems like I would need to patch the `baseClone` function?

`throttle` with default options invokes the function more frequently than expected. It seems very unlikely that this is intended behavior, and it's inconsistent with underscore behavior.

Reproductions steps:

1. Call a throttled function twice
1. `leadingEdge` is invoked
1. Wait for the throttle period (`wait`)
1. `trailingEdge` is invoked
1. Call the throttled function again immediately afterwards
1. `leadingEdge` is invoked, even though `trailingEdge` was just invoked

The root cause is fairly obvious, and has nothing to do with setTimeout inconsistencies. `shouldInvoke` looks like:

```javascript
  function shouldInvoke(time) {
    var timeSinceLastCall = time - lastCallTime,
        timeSinceLastInvoke = time - lastInvokeTime;

    // Either this is the first call, activity has stopped and we're at the
    // trailing edge, the system time has gone backwards and we're treating
    // it as the trailing edge, or we've hit the `maxWait` limit.
    return (lastCallTime === undefined || (timeSinceLastCall >= wait) ||
      (timeSinceLastCall < 0) || (maxing && timeSinceLastInvoke >= maxWait));
  }
```

`timeSinceLastCall` is the time since `debounced` was last invoked. Therefore, in the above scenario, on step 5 `shouldInvoke` returns `true`, and `leadingEdge` is called.

Discovered in a unit test that looks something like:

```javascript
import { expect } from 'chai';
import sinon from 'sinon';
import throttle from 'lodash.throttle';

describe('lodash.throttle', () => {

	let clock;
	let invokeCount;
	let lastInvoked;

	const func = () => {
		invokeCount++;
		lastInvoked = Date.now();
	}

	const waitFor = ms => new Promise(resolve => {
		setTimeout(resolve, ms);
		clock.tick(ms);
	});


	beforeEach(() => {
		clock = sinon.useFakeTimers();
		invokeCount = 0;
		lastInvoked = undefined;
	});

	afterEach(() => clock.restore());

	it('invokes func at most once every 10 seconds', () => {
		const throttlePeriod = 10;
		const throttled = throttle(func, throttlePeriod);

		expect(invokeCount).to.equal(0);

		throttled();
		throttled();

		expect(invokeCount).to.equal(1);

		return waitFor(throttlePeriod).then(() => {
			expect(invokeCount).to.equal(2);

			throttled();

			expect(invokeCount,
				`throttled was called ${invokeCount} in ${Date.now()} ms.
				Current Time: ${Date.now()}, lastInvoked: ${lastInvoked}`
			).to.equal(2);
		});
	});
});
```

